import React from 'react';
import './App.css';
import CanvasDraw from "react-canvas-draw";
function App() { 
  return (
    <div className="App">
       <CanvasDraw 
        className="canvas"
         hideGrid="true"
         brushRadius="5"
         lazyRadius="0"
       />    
        <button onClick={CanvasDraw.undo()}></button>
    </div>
  );
}

export default App;
